import React, { useEffect, useState } from "react";
import { getProduct } from "../services/productService";
const Product = (props) => {
    const [data, setData] = useState({});
    const[users , setUser] = useState([]);
    function replacer(key, value) {
      if (key === 'name') {
        return undefined;
      }
      return value;
    }
    useEffect(() => {
      (async () => {
        setData(await getProduct());
      })();
    }, []);
   
    return (
      <>
        <table id="table">
          <thead>
            <tr>
              <th>Id</th>
              <th>Name</th>
              <th>Email</th>
              <th></th>
            </tr>
          </thead>
          <tbody>
            {this.state.data.map((data) => (
              <tr key={data.id}>
                <td>{data.id}</td>
                <td>{data.name}</td>
                <td>{data.email}</td>
                <td>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
        <pre>{JSON.stringify(data, replacer)}</pre>
      </>
    );
  };
  
  export default Product;
